webpackJsonp([0xd62b2bbc1c7b],{5315:function(t,e){t.exports={data:{post:{html:"<p>Mama and Christopher are off to Oma Ruth's today, to give her some help for her move at the end of September. She'll then be in Buchholz,  5 minutes away instead of 90 minutes. Anyway, on my last vacation day I'm bach'ing it. (That's 'Strohwitwe' for the German audience.)</p>\n<p>The test site <a href=\"http://www.papascott.de\">papascott.de</a> got <a href=\"http://www.dangerousmeta.com/posts/01/20010816\">dang-meta'ed</a>. I've started putting up some real content so that the folks don't get too bored.</p>",fields:{title:"Day Off",date:"17 Aug 2001",url:"https://papascott.de/2001-08-17-day-off/"}}},pathContext:{slug:"/2001-08-17-day-off/",prev:{fields:{title:"Sun Is Shining",date:"16 Aug 2001",slug:"/2001-08-16-sun-is-shining/"}},next:{fields:{title:"Self Serve",date:"18 Aug 2001",slug:"/2001-08-18-self-serve/"}}}}}});
